// import axios from 'axios';
import './PurchaseNew.css';

function PurchaseNew() {

  const handleSubmit = (e) => {
    e.preventDefault();

    const data = new FormData(e.target);

    //Su Fetch Funkcija
    fetch('http://localhost:8000/api/products', {
      body: data,
      method: 'POST'
    })
      .then(resp => resp.text())
      .then(resp => console.log(resp));

    // axios.post('http://localhost:8000/api/purchases', data)
    // .then(resp => {
    // setMessage({m: resp.data, s: 'success'});
    // setTimeout(() => navigate('/admin'), 2000);
    // })
    // .catch(error => {
    // setMessage({m: error.response.data, s: 'danger'})
    // })
    // .finally(() => setLoading(false));
  }

  return (
    <form onSubmit={handleSubmit}>
      <div className="inputField">
        <lable>Date of purchase</lable>
        <input type="date" name="purchase_date" />
      </div>
      <div className="inputField">
        <lable>Place of purchase, Shop</lable>
        <input type="text" name="purchase_place" /> {/* chane to select */}
      </div>
      <div className="inputField">
        <lable>Payment method</lable>
        <input type="text" name="payment_method" /> {/* chane to select */}
      </div>
      <div className="documents">
        Documents:
        <div className="inputField">
          <lable>Initial offer</lable>
          <input type="text" name="offer_doc" />
        </div>
        <div className="inputField">
          <lable>Purchase</lable>
          <input type="text" name="purchase_doc" />
        </div>
        <div className="inputField">
          <lable>Initial prepayment</lable>
          <input type="text" name="prepay_doc" />
        </div>
        <div className="inputField">
          <lable>Final payment</lable>
          <input type="text" name="final_payment_doc" />
        </div>
        <div className="inputField">
          <lable>Invoice</lable>
          <input type="text" name="invoice" />
        </div>
        <div className="inputField">
          <lable>Other documents</lable>
          <input type="text" name="other_docs" />
        </div>
      </div>
      <div className="inputField">
        <lable>comments</lable>
        <input type="text" name="coments" />
      </div>
      <div className="inputField">
        <lable>Finished</lable>
        <input type="checkbox" name="finished" />
      </div>
      <button type="button">Save</button>
    </form>
  )
}

export default PurchaseNew;
